import React from "react";
import Link from "./Link";
export default function Sidebar(props) {
  return (
    <aside>
      <ul>
        {props.posts &&
          props.posts.map((post, id) => (
            <Link title={post.title} index={post.id} />
          ))}
      </ul>
    </aside>
  );
}
